query tokens {
  tokens(block: {number: 980288}, where: {id: "0xe0e514c71282b6f4e823703a39374cf58dc3ea4f"}) {
    ...TokenFields
    __typename
  }
  pairs0: pairs(where: {token0: "0xe0e514c71282b6f4e823703a39374cf58dc3ea4f"}, first: 50, orderBy: reserveUSD, orderDirection: desc) {
    id
    __typename
  }
  pairs1: pairs(where: {token1: "0xe0e514c71282b6f4e823703a39374cf58dc3ea4f"}, first: 50, orderBy: reserveUSD, orderDirection: desc) {
    id
